(9, '0012', 'যশোরের সিমম কাজের শাড়ীযশোরের সিমম কাজের শাড়ী', '21.0000', '33.0000', 12, 10, '/images/f9891dbe-88e9-4d71-b3ee-05631b4b149e.jpg', 4, 4, 5, '20.0000', 23, '<p>this is a sharee</p>\r\n', 15, 7, 48, '12.0000', 0, NULL, NULL, NULL, NULL, '[\"শাড়ি\"]', 0, '1.0000', 60, 3, '2018-11-06 20:16:27', '2018-08-07 12:12:20', '2020-11-21 12:50:39', '2020-11-02 00:00:00'),
(10, '0001', 'COTTON SHORT SLEEVE POLO FOR MEN', '300.0000', '400.0000', 1, 10, '/images/b374e35e-c384-4dfe-9c47-5169a49b9f34.jpg', 5, 9, 23, '20.0000', 23, '<p>&nbsp;</p>\n\n<p>This polo is perfect for the young and smart person. It is normally associated with collar and placket with typically two or three buttons, and an optional pocket. A dress-length version of the shirt is called a polo dress. It is made of cotton fabrics. This polo will make a fashion conscious person like you smarter than ever. It is comfortable during your workout and is easy to clean.</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n', 8, 7, 48, '100.0000', 1, '23.0000', '2018-10-18', '2018-10-31', 1, '[\"winter\",\"summer\",\"men\"]', 1, '0.2000', 30, 1, '2018-11-15 00:00:00', '2018-08-13 19:33:24', '2020-11-21 12:50:39', '2020-11-01 18:46:02'),
(12, '0002', 'Monolova Light Gray and Coral Sateen Unstitched Salwar', '250.0000', '450.0000', 1, 10, '/images/c0e83d28-a72f-489d-81ff-603c32cfef76.jpg', NULL, 8, 9, '20.0000', 23, '<p>&nbsp;</p>\n\n<p>Salwar Kameez, also spelled salwar kameez or shalwar qameez, is a traditional outfit originating in the subcontinent. It is a generic term used to describe different styles of dress. The salwar kameez can be worn by women. The salwar and the kameez are two garments which are combined to form the salwar kameez.<br />\n&nbsp;</p>\n', 15, 7, 48, '200.0000', 1, '100.0000', '2018-10-18', '2018-10-25', 1, '[\"hot\",\"winter\"]', 0, '0.3000', 60, 2, '2018-11-06 20:16:27', '2018-08-13 19:52:34', '2020-11-21 12:50:39', '2020-11-01 18:45:57'),
(13, '0003', 'Monolova Light Gray and Coral Sateen Unstitched Salwar Kameez for Women', '250.0000', '450.0000', 1, 10, '/images/e65f3c51-f149-464e-87f3-672dd53bf4a6.jpg', 3, 8, 9, '20.0000', 23, '<p>&nbsp;</p>\n\n<p>Salwar Kameez, also spelled salwar kameez or shalwar qameez, is a traditional outfit originating in the subcontinent. It is a generic term used to describe different styles of dress. The salwar kameez can be worn by women. The salwar and the kameez are two garments which are combined to form the salwar kameez.<br />\n&nbsp;</p>\n', 1, 7, 48, '200.0000', 1, '32.0000', '2018-10-18', '2018-11-01', 12, '[\"hot\",\"winter\"]', 0, '0.3000', 60, 3, '2018-11-20 00:00:00', '2018-08-13 20:27:54', '2020-11-21 12:50:39', '2020-11-03 00:00:00'),
