(60, 'TN-9', 'Comfortable Tank Top for Girls', NULL, '95.0000', 1, 12, '/images/29e3ace8-525a-48ad-a48e-ca47cebf45ed.jpeg', NULL, 46, NULL, '20.0000', 22, '<p>Material: 95% Cotton / 5% Spandex.</p>\n\n<p>Do Not Bleach.</p>\n\n<p>The actual fabric of spaghetti straps might be different.</p>\n\n<p>Machine Wash Cold / Do Not Bleach / Dry Flat Iron Low.</p>\n\n<p>Pull on Closure.</p>\n\n<p>Made in a longer length to flatter! Soft, Stretchy &amp; Comfortable.</p>\n\n<p>This essential tank is great for layering.</p>\n\n<p>Size:&nbsp;S, M, L, XL, 2XL, 3XL, 4XL, 5XL.</p>\n\n<p>Measurement (In Inches): S (Waist: 24&quot;, Body: 32&quot;, Hips: 34&quot;), M (Waist: 26&quot;, Body: 33&quot;, Hips: 35&quot;), L (Waist: 28&quot;, Body: 35&quot;, Hips: 37&quot;), XL (Waist: 29&quot;, Body: 37&quot;, Hips: 39&quot;), 2XL (Waist: 31&quot;, Body: 39&quot;, Hips: 41&quot;), 3XL (Waist: 33&quot;, Body: 41&quot;, Hips: 43&quot;), 4XL (Waist: 35&quot;, Body: 43&quot;, Hips: 45&quot;), 5XL (Waist: 37&quot;, Body: 45&quot;, Hips: 47&quot;).</p>\n\n<p>Color: As same as picture.</p>\n', 4, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"Tank Top\"]', 0, '0.2000', NULL, 1, '2020-10-31 11:57:21', '2020-10-31 11:57:21', '2020-11-21 12:50:39', NULL),
(61, 'DF115', 'Stylish T-shirt for Women (I Found)', NULL, '160.0000', 1, 12, '/images/33ca168e-2aa5-4d39-bed9-734a6e63364b.jpeg', NULL, 46, NULL, '20.0000', 22, '<p>Stylish T-shirt for Women (I Found) - DF115.</p>\n\n<p>Can be a special gift for your loved ones.</p>\n\n<p>Fabrics: 100% cotton.</p>\n\n<p>Color: As same as picture.</p>\n\n<p>Gender: Women.</p>\n\n<p>Fabrication: 145-150 GSM.</p>\n\n<p>Size: M, L, XXL.</p>\n\n<p>Measurement (In Inch): M (Chest: 34&quot;, Length: 26&quot;); L (Chest: 35&quot;, Length: 27&quot;); XXL (Chest 38&quot;, Length 29&quot;).</p>\n\n<p><strong>This product will be delivered within 48 hours. But if your order consists of other products along with it, these will be delivered altogether as per regular delivery time.</strong></p>\n', 4, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"Stylish T-shirt\",\"T-shirt\"]', 0, '0.2000', NULL, 1, '2020-10-31 12:00:33', '2020-10-31 12:00:33', '2020-11-21 12:50:39', NULL),
(62, '729', 'KODOMO Baby Shampoo Yellow', NULL, '350.0000', 1, 12, '/images/6bf0e5be-fcf6-4c39-aee2-0c0264780031.jpeg', NULL, 49, NULL, '20.0000', 22, '<p>KODOMO Baby Shampoo Yellow - 100ml.</p>\n\n<p>Brand: KODOMO.</p>\n\n<p>Product Type: Baby Shampoo.</p>\n\n<p>Weight: 100ml.</p>\n\n<p>Age: New Born.</p>\n\n<p>This product is pH balanced, hence it does not make your baby&rsquo;s eyes water, making it suitable for frequent shampooing.</p>\n\n<p>Using only the finest ingredients.</p>\n\n<p>Mild fragrance.</p>\n\n<p>Tested to International Dermatological Standards.</p>\n\n<p><strong>Note: This item will not be delivered outside Dhaka.</strong></p>\n', 25, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"Baby Shampoo\"]', 0, '0.2500', NULL, 1, '2020-10-31 12:17:16', '2020-10-31 12:17:16', '2020-11-21 12:50:39', NULL),
(63, '1188', 'Himalaya Prickly Heat Baby Powder', NULL, '260.0000', 1, 12, '/images/d9da19f1-629b-4ad2-8adf-1f594d4a19c8.jpeg', NULL, 49, NULL, '20.0000', 22, '<p>Himalaya Prickly Heat Baby Powder &ndash; 200 gm<strong>.</strong></p>\n\n<p>Brand: Himalaya.</p>\n\n<p>Product Type: Baby Powder.</p>\n\n<p>Weight: 200 gm.</p>\n\n<p><strong>What does it do:</strong></p>\n\n<p>Relieves Prickly Heat.</p>\n\n<p>Himalaya Prickly Heat Baby Powder provides relief from prickly heat and keeps baby fresh, cool, and happy.</p>\n\n<p>Helps prevents body odor and controls excessive sweating.</p>\n\n<p><strong>Key Ingredients:</strong></p>\n\n<p>Vetiver, possessing an astringent property is known to manage excessive sweating and cools and refreshes baby&#39;s skin.</p>\n\n<p>Yashada bhasma&nbsp;is known for anti-microbial properties and has traditionally been used as a wound-healing agent.</p>\n\n<p>Neem&nbsp;is a revered herb in Ayurveda which is renowned for its benefits against skin infections and itching.</p>\n\n<p><strong>Direction for use:</strong></p>\n\n<p>Sprinkle Himalaya Prickly Heat Baby powder on to your palms and apply on baby&#39;s skin after bath and whenever necessary.</p>\n\n<p><strong>CAUTION:</strong></p>\n\n<p>Avoid using around baby&#39;s eyes, nose, mouth, and sensitive areas. Do not sprinkle directly onto baby&#39;s skin to avoid accidental inhalation.</p>\n', 25, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"Himalaya Prickly\"]', 0, '0.2000', NULL, 1, '2020-10-31 15:18:01', '2020-10-31 15:18:01', '2020-11-21 12:50:39', NULL),
(64, '000124', 'JEAN BACKPACK', NULL, '1080.0000', 1, 12, '/images/7b764f1e-be63-4772-a948-de5c4ed62b80.jpg', NULL, 45, NULL, '20.0000', 22, '<p>Backpacks are a great choice for busy weekends and overnight stays. Our Jean Backpack is also perfect for everyday use! Jean is spacious enough inside for your laptop, tablet or even a spare pair of sneakers. Made from our smooth Soft Grain Leather, Jean is a sophisticated take on the backpack, and a true showstopper. Jean is equipped with zipped closure for safety, and shoulder straps that are easy to adjust. Jean&rsquo;s Black color is timeless yet totally on-trend, which makes this the classic bag it is. There&rsquo;s just no wrong way to wear it, it simply matches everything.</p>\n', 4, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"bag\"]', 0, '2.0000', NULL, 1, '2020-11-12 16:38:07', '2020-11-12 16:38:07', '2020-11-21 12:50:39', NULL),
(65, '000123', 'Metropolitan Soft Brief In Colorblock Signature Canvas', NULL, '1250.0000', 1, 12, '/images/7368f485-529e-4eef-8f05-f2d9e2f8f44b.png', NULL, 45, NULL, '20.0000', 22, '<p>The Metropolitan is a no-fuss bag made for the modern man. Designed with a tech sleeve for a tablet and space for a 13&quot; laptop, this effortless brief is crafted in a colorblock mix of our Signature canvas and refined leather. It&rsquo;s finished with a detachable lightweight nylon strap for versatile wear.</p>\n', 4, 7, NULL, NULL, 1, '500.0000', '2020-11-30', '2020-12-30', 10, '[\"bags\"]', 0, '2.0000', NULL, 1, '2020-11-14 13:38:19', '2020-11-14 13:38:19', '2020-12-12 11:02:49', NULL),
(66, '003456', 'Rivington Backpack In Signature Jacquard', NULL, '1300.0000', 1, 12, '/images/31ecea61-1828-4526-beff-da2683f6c698.jpg', NULL, 9, NULL, '20.0000', 22, '<p>Like the New York City street it&rsquo;s named after, Rivington mixes downtown cool with professional good looks. This soft backpack is crafted in our lightweight, water-resistant</p>\n', 8, 7, NULL, NULL, 0, NULL, NULL, NULL, NULL, '[\"bags\"]', 0, '2.0000', NULL, 1, '2020-11-14 13:42:32', '2020-11-14 13:42:32', '2020-11-21 12:50:39', NULL),
